export class AngioIRMCerbrale {
    PatientId: number;
    AngioIrmcerbrale1: boolean;
    DateIrm?: string; // Use string for date to handle formatting issues
    SansAnomalies?: boolean;
    Infarctus?: boolean;
    PreciserInfarctus?: string;
    Stenose?: boolean;
    PreciserStenose?: string;
    MoyaMoya?: boolean;
    Autre?: boolean;
    Text?: string;
  
    constructor() {
      this.PatientId = 0;
      this.AngioIrmcerbrale1 = false;
      this.DateIrm = ''; // Initialize as empty string
      this.SansAnomalies = false;
      this.Infarctus = false;
      this.PreciserInfarctus = '';
      this.Stenose = false;
      this.PreciserStenose = '';
      this.MoyaMoya = false;
      this.Autre = false;
      this.Text = '';
    }
  }
